import React from "react";
import { Navigate } from "react-router-dom";
const AdminRoutes = (probs) => {
  console.log(probs.isAdmin === false);
  if (probs.isAdmin === false) {
    return <Navigate to="/" />;
  }
  return probs.children;
};
export default AdminRoutes;
